GameData["ui_ext"]["ui_info"]["help_text_list"]["text_01"] = [[$16111141]]
GameData["ui_ext"]["ui_info"]["help_text_list"]["text_02"] = [[$16111142]] -- - Provides access to the Adepta Sororitas' most powerful units.
GameData["ui_ext"]["ui_info"]["help_text_list"]["text_03"] = [[$16111143]] -- - Produces: Saint Anais, Saint Emiline, Saint Arabella, Saint Celestine, and the ultimate Arch Angel.
GameData["ui_ext"]["ui_info"]["help_text_list"]["text_04"] = [[$16111144]] -- - Contains research to further improve Saints and the Arch Angel.
GameData["ui_ext"]["ui_info"]["help_text_list"]["text_05"] = [[$16111145]]
GameData["ui_ext"]["ui_info"]["help_text_list"]["text_06"] = [[$16111146]] -- - Generates a small amount of faith over time.
GameData["ui_ext"]["ui_info"]["help_text_list"]["text_07"] = [[$16111147]] -- - Allows units: Preceptor, Throne of Judgement, Redemptionist Squads, Legatine Squads, Excorcists, Exorcist Sanctorums, Penitent Engines, and Incarcerators. 
GameData["ui_ext"]["ui_info"]["help_text_list"]["text_08"] = [[$16111148]] -- - Unlocks: Holy Retribution.
